style.css:
@-moz-document domain("study4.com") {
:root {
    --bg-color: #161f31;
    --bg-dark-color: #121928;
    --fg-color: #c9d8ee;
    --fg-dark-color: #a9bad6;
    --red-color: #ff3939;
    --orange-color: #ff9f39;
    --yellow-color: #ffea39;
    --purple-color: #d62ed6;
    --cyan-color: #42caca;
    --green-color: #64f923;
    --blue-color: #5889ff;
    --pink-color: #f36cde;
    --border-color: #e1e1e1;
    --none: none;
  }

  * {
    box-shadow: none;
  }

  div,
  dl,
  dt,
  dd,
  ul,
  ol,
  li,
  pre,
  label,
  fieldset,
  input,
  p,
  blockquote,
  th,
  td,
  i,
  i::before,
  font,
  body {
    color: var(--fg-color) !important;
  }
  pre[class^="language"],
  code {
    background: var(--bg-dark-color) !important;
    color: var(--fg-dark-color) !important;
  }

  h1,
  h2,
  h3,
  h4,
  h5,
  h6 {
    color: white !important;
  }

  ins {
    color: var(--green-color) !important;
    background: none !important;
  }

  del {
    color: var(--red-color) !important;
    background: none !important;
  }

  a {
    color: var(--pink-color);
    border: none !important;
  }

  a:link {
    color: var(--cyan-color);
  }

  a:hover *,
  a:hover {
    color: var(--orange-color) !important;
  }

  button {
    border: 1px solid var(--border-color) !important;
    background: black !important;
    color: var(--fg-color) !important;
  }

  button:hover {
    opacity: 0.8;
  }

  body {
    background: var(--bg-color);
  }

  table {
    border-collapse: collapse !important;
  }

  table,
  noscript,
  select,
  input,
  tr,
  td,
  th,
  option {
    border: 1px solid var(--border-color) !important;
    background: var(--bg-dark-color) !important;
    color: var(--fg-color) !important;
  }

  .xl-container {
    background: var(--bg-color);
  }
  .topnav-container {
    background: black !important;
    color: var(--fg-color) !important;
  }
  #test-content {
    background: var(--bg-dark-color) !important;
    color: var(--fg-color) !important;
  }

  .plyr__controls {
    border: 1px solid var(--border-color) !important;
    background: black !important;
    color: var(--fg-color) !important;
  }

  #test-navigation__inner {
    background: var(--bg-dark-color) !important;
    color: var(--fg-color) !important;
  }
  .nav-link {
    background: black !important;
    border: 1px solid var(--border-color) !important;
    color: var(--fg-color) !important;
  }

  .testitem-wrapper {
    background: var(--bg-dark-color) !important;
    border: 1px solid var(--border-color) !important;
    color: var(--fg-color) !important;
  }
  .content-header {
    background: var(--bg-dark-color) !important;
  }
  .user-target-info-box {
    background: black !important;
    border: 1px solid var(--border-color) !important;
    color: var(--fg-color) !important;
  }
  .tag {
    background: black !important;
    border: 1px solid var(--border-color) !important;
    color: var(--fg-color) !important;
  }
  .page-item > .page-link {
    background: black !important;
    border: 1px solid var(--border-color) !important;
    color: var(--fg-color) !important;
  }
  .active > .page-link {
    background: var(--orange-color) !important;
    color: black !important;
  }
  .footer-wrapper {
    background: var(--bg-dark-color) !important;
    color: var(--fg-color) !important;
  }
  .btn-sm {
    background: black !important;
    border: 1px solid var(--border-color) !important;
    color: var(--fg-color) !important;
  }
  .container {
    background: var(--bg-color);
  }
  .contentblock {
    background: var(--bg-dark-color) !important;
    color: var(--fg-color) !important;
  }

  .home-section {
    background: var(--bg-dark-color) !important;
    color: var(--fg-color) !important;
  }

  .alert {
    background: black !important;
    color: var(--yellow-color) !important;
  }
  .question-group-wrapper div,
  .context-wrapper {
    background: var(--bg-dark-color) !important;
    color: var(--fg-color) !important;
  }

  .question-group-wrapper,
  .question-twocols-left {
    border: 1px solid var(--border-color) !important;
    color: var(--fg-color) !important;
  }

  .courses-grid-item {
    background: var(--bg-dark-color) !important;
    color: var(--fg-color) !important;
  }

  .dropdown-menu {
    background: black !important;
    border: 1px solid var(--border-color) !important;
    color: var(--fg-color) !important;
  }
.result-stats-box {
  background: var(--bg-dark-color) !important;
}
 .result-score-box {
	background: var(--bg-dark-color) !important;
}
.lg-container{
  background: var(--bg-color) !important;
}
}
